import React from 'react';

function TodoFilter(props)  {

		return (
			<div className="todo-footer-container">
				<div className="todo-count">{props.len} items left</div>
				<div className="todo-menus">
					<span className="active" onClick={()=> props.changeState(0)}>All</span>
					<span onClick={()=> props.changeState(1)}>Active</span>
					<span onClick={()=> props.changeState}>Complete</span>
				</div>
			</div>
		);
	}


export default TodoFilter;
